ingVerification\n  Scenario Outline: Meter UI and button clicks verifications on POB Screen\n    Given Meter Alerts comes as Driver move to the POB screen\n    When Verify Cost value and text on POB screen\n    And check distance \"<distance>\" text on POB screen\n    And check to verify miles covered values and text on POB screen\n    And Check Progress loader icon on POB screen\n    And check pob lable \"<waiting>\" text\n    And Check pob time value\n    And click on Meter expand button on pob to see meter details\n    And check tariff \"<tariff>\" text on POB screen\n    And check pob screen tariff value \"<tariffvalue>\" text\n    And Check meter pob \"<waitlabel>\" text\n    And check meter pob value\n    And Check meter extra \"<extra>\" text on pob screen\n    And check meter extra value on pob\n    And Check meter discount percentage \"<discountper>\" text on pob screen\n    And check meter discount percentage value on pob screen\n    And Check stop waiting \"<stopwaiting>\" text on pob screen\n    And click on Stop waiting button on pob screen\n    And Check Start waiting \"<startwaiting>\" text on pob screen\n    And click on Start waiting button again on pob screen\n    And Check to verify stop meter \"<stopmeter>\" text on pob screen\n    And click on Stop meter button on pob screen\n    And check to verify Start meter \"<startmeter>\" text on pob screen\n    And click on Start meter button on pob screen\n    And check to verify Add extra charges \"<addextracharges>\" on pob screen\n    And Verify customer image on pob screen\n    And verify customer name on pob screen\n    And message chat icon on pob screen\n    And click again on Meter expand button to close meter details on pob screen\n    Then Meter UI texts and buttons clicks are verified on pob screen\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting  | startwaiting  | stopmeter  | startmeter  | addextracharges   |\n nd click on Stop waiting button on stc screen\n    And Check Start waiting \"<startwaiting>\" text on stc screen\n    And click on Start waiting button again on stc screen\n    #And Check to verify stop meter \"<stopmeter>\" text on stc screen\n    #And click on Stop meter button on stc screen\n    #And check to verify Start meter \"<startmeter>\" text on stc screen\n    #And click on Start meter button on stc screen\n    And check to verify Add extra charges \"<addextracharges>\" on stc screen\n    And Verify customer image on stc screen\n    And verify customer name on stc screen\n    And message chat icon on stc screen\n    And check Card Payemnt image icon on stc screen\n    And check QR code image icon on stc screen\n    And click again on Meter expand button to close meter details on stc screen\n    Then Meter UI texts and buttons clicks are verified on stc screen\n\n    Examples: \n      | distance | waiting | tariff | tariffvalue | waitlabel | extra | discountper         | stopwaiting   | startwaiting | stopmeter  | startmeter | addextracharges   |\n      | Distance | Waiting | Tariff | T1          | Waiting   | Extra | Discount Percentage | Stop Waiting | Start Waiting | Start Meter | Start Meter | Add extra charges |\n\n  @OnboardingVerification\n  Scenario Outline: STC Screens UI and buttons clicks verifications\n    When Driver is on STC Screen and lets verify Waiting screens UI and texts fields\n    And move scroll up so that pick and drop address and screen UI are visible on stc screen\n    And verify stc screen current location icon\n    And verify stc screen start navigation icon\n    And verify stc screen pickup whole box\n    And verify stc screen dropoff whole box\n    And Check stc screen pickup zone text\n    And Check stc screen pickup address text\n    And check stc screen dropoff zone text\n    And check stc screen dropoff Address text\n    And check change dropoff address \"<dropoffaddress>\" text on stc screen\n    And check stc screen jobtype text\n    And check stc screen payment text\n    And check stc screen Booking text\n    And check stc screen tariff text\n    And check stc screen driver notes text\n    And check Clear button \"<clear>\" text\n    And move scroll down so that pick and drop address and screen UI are not visible on stc screen\n    Then STC Job screen UI elements are verified\n\n    Examples: \n      | clear | dropoffaddress |\n      | Clear | Change         |\n\n  @Onboarding\n  Scenario Outline: To move Job to Feedback screen and Job status become completed as driver click on clear button\n    When Driver Click on clear button\n    Then Driver move to the Feedback screen\n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/10_JobSTC_Screen.feature","feature":{"location":{"line":1,"column":1},"tags":[],"language":"en","keyword":"Feature","name":"STC Screen UI verification and Complete Testing","description":"","children":[{"scenario":{"location":{"line":4,"column":3},"tags":[{"location":{"line":3,"column":3},"name":"@OnboardingVerification","id":"7b9084ae-f63c-4b43-834e-c49d886f8ceb"}],"keyword":"Scenario Outline","name":"Meter UI and button clicks verifications on STC Screen","description":"","steps":[{"location":{"line":5,"column":5},"keyword":"Given ","keywordType":"Context","text":"Meter Alerts comes as Driver move to the STC screen","id":"71b80ca2-fccf-4441-85bb-cf02b7b0fff6"},{"location":{"line":6,"column":5},"keyword":"When ","keywordType":"Action","text":"Verify Cost value and text on STC screen","id":"744df27d-c26d-4c43-a0db-3e9a7b72614f"},{"location":{"line":7,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"check distance \"<distance>\" text on STC screen","id":"3ba3bf0e-deb7-40da-8d0d-8515be4fe2b5"},{"location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"check to verify miles covered values and versMessages\n  Scenario Outline: Drivers Messages verification on Accepted screen\n    Given Job has been received on DM8 and Accept it for Drivers Messages verifications\n    When click on message icon chat button on Accepted screen\n    And check Message whole alerts on Accepted screen\n    And check alerttitle \"<msg>\" text on Accepted screen\n    And click message chat icon button for second time on Accepted screen\n    And chech to verify message area on Accepted screen\n    And check to verify cancle \"<cnle>\" button text Accepted screen\n    And check to verify send \"<send>\" button text on Accepted screen\n    And click message chat icon to send message on Accepted screen\n    And click on message button on Accepted screen\n    And click on send button button on Accepted screen\n    And click on move job to waiting status for Chat message verification\n    Then All UI and text are verified on Accepted screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on Waiting screen\n    Given Job are in waiting status\n    When click on message icon chat button on Waiting screen\n    And check Message whole alerts on Waiting screen\n    And check alerttitle \"<msg>\" text on Waiting screen\n    And click message chat icon button for second time on Waiting screen\n    And chech to verify message area on Waiting screen\n    And check to verify cancle \"<cnle>\" button text Waiting screen\n    And check to verify send \"<send>\" button text on Waiting screen\n    And click message chat icon to send message on Waiting screen\n    And click on message button on Waiting screen\n    And click on send button button on Waiting screen\n    And click on move job to pob status for Chat message verification\n    Then All UI and text are verified on Waiting screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on POB screen\n    Given Job are in pob status\n    When click on message icon chat button on POB screen\n    And check Message whole alerts on POB screen\n    And check alerttitle \"<msg>\" text on POB screen\n    And click message chat icon button for second time on POB screen\n    And chech to verify message area on POB screen\n    And check to verify cancle \"<cnle>\" button text POB screen\n    And check to verify send \"<send>\" button text on POB screen\n    And click message chat icon to send message on POB screen\n    And click on message button on POB screen\n    And click on send button button on POB screen\n    And click on move job to stc status for Chat message verification\n    Then All UI and text are verified on POB screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  @OnboardingDriversMessages\n  Scenario Outline: Drivers Messages verification on STC screen\n    Given Job are in stc status\n    When click on message icon chat button on STC screen\n    And check Message whole alerts on STC screen\n    And check alerttitle \"<msg>\" text on STC screen\n    And click message chat icon button for second time on STC screen\n    And chech to verify message area on STC screen\n    And check to verify cancle \"<cnle>\" button text STC screen\n    And check to verify send \"<send>\" button text on STC screen\n    And click message chat icon to send message on STC screen\n    And click on message button on STC screen\n    And click on send button button on STC screen\n    And click on move job to clear status for Chat message verification\n    Then All UI and text are verified on STC screen\n\n    Examples: \n      | msg      | cnle   | send |\n      | Messages | CANCEL | SEND |\n\n  #@OnboardingDriversMessages\n  #Scenario Outline: Drivers Messages verification on Clear screen\n    #Given Job are in clear status\n    #When click ngeAndAddExtracharges.feature","data":"Feature: Verify Go back and Change dropoff address and Add Extra charges verification on Job flow\n\n  @OnboardingGobackChangeDropoffAddextra\n  Scenario Outline: Create a job from evop to verify Goback and change dropoff address and Add extra charges\n    Given Job request are given for Goback and change dropoff address and Add extra charges verification\n    When Job request are send to the server for Goback and change dropoff address and Add extra charges verification\n    Then new job has been created in order to check and verify Goback and Change dropoff and extra charges\n\n  @OnboardingGoback\n  Scenario Outline: Go back button functionality verification on Job status\n    Given Job has been received on DM8 and Accept and move to STC status to verify Go back in all job status\n    When scroll up the screen so that Go back button are visible\n    And check that Driver are in STC status by verifying clear \"<clr>\" button text\n    And Click on Back button on STC status\n    And check to verify driver get back to POB status by verifying stc \"<stc>\" button text\n    And click on Go back button POB status\n    And check to verify driver get back to Waiting status by verifying pob \"<pob>\" button text\n    And click on Back button on waiting status\n    And check to verify driver get back to Accepted status by verifying waiting \"<wait>\" button text\n    Then Go back button are verified in all job status\n\n    Examples: \n      | clr   | stc   | pob   | wait    |\n      | Clear | S.T.C | P.O.B | Waiting |\n\n  @OnboardingChangeDropoff\n  Scenario Outline: Change dropoff Address functionality verification on Job status\n    Given Job Status should be in POB by verifying stc \"<stc>\" to check for ChangeDropoff address\n    When Click on Change dropoff address button\n    And check to verify Change Address whole alert\n    And check to verify Change Address title \"<titile>\" text\n    And check to verify change address Alert messages dialog\n    And check verify cancel \"<cnl>\" button text on change address dialog\n    And check to verify update \"<update>\" text on change address dialog\n    And click on first address to change dropoff zone address\n    And click on Update button to update the address on POB status\n    And now move job to STC status to check address change again\n    And click on change address button on STC status\n    And click on address zone on STC status\n    And click on Update button on STC status\n    Then Change address is properly working and address zone can be changed easily\n\n    Examples: \n      | stc   | titile        | cnl    | update |\n      | S.T.C | Dropoff Zones | CANCEL | UPDATE |\n\n  @OnboardingAddExtra\n  Scenario Outline: Verify Add Extra Charges on Job status\n    Given Job Status should be in POB by verifying stc \"<stc>\" to check for Adding extra charges\n    When Scroll screen so that Add extra button should be clickable\n    And click on Add Extra button on POB status\n    And check to verify whole Extra Alert on POB status\n    And check to verify title \"<extratitle>\" text on Add Extra alert\n    And check whole message area on Add Extra alert\n    And check cancle \"<cnl>\" text on Add extra alert\n    And check ok \"<ok>\" text on Add extra alert\n    #And click to Enter \"<pound>\" pound extra value\n    And click on OK button to add Extra charges\n    And move job to STC screen to add Extra charges\n    And click on Add Extra button STC screen\n    #And click to Add \"<pound>\" more extra pounds on STC screen\n    And agin click on OK button to add more Extra on STC screen\n    And click to Clear and submit feedback of job with Extra value added\n    Then Adding Extra charges can be added easily on both POB and STC Job status\n\n    Examples: \n      | stc   | extratitle                 | cnl    | ok | pound |\n      | S.T.C | Please enter extra amount: | CANCEL | OK |    10 |\n","mediaType":"text/x.cucumber.gherkin+plain" s/mac/git/DM8_Automation/Infocabs-DM8-Android-IOS-Automation/src/test/resources/Featuresfiles/19_JobPaymentwithCardandQRCode.feature","data":"Feature: Verify that Driver can be able to pay Job payment using Cards and QR code\n\n  @OnboardingDriverPayment\n  Scenario Outline: Create a job from evop to verify Driver can pay the Card and QR code payment\n    Given Job request are given for Card and QR code payment\n    When Job request are send to the server for or Card and QR code payment\n    Then new job has been created in order to check and verify or Card and QR code payment\n\n  @OnboardingDriverPayment\n  Scenario Outline: Card Payment Verification\n    Given Job has been received on DM8 and Accept and move to STC status to verify Card payment\n    When check that Driver are in STC status by verifying clear \"<clr>\" button text for Card payments\n    And Click on Card payment button so that Card screen should be opend\n    And check for Visa Card payment button\n    And check for MasterCard payment button\n    And check for American Express payment button\n    And check for surcharge text\n    And check for pay button text\n    And check for payment cancle \"<cnl>\" text\n    And click on Cancle button on payment screen\n    Then Payment screen icons and UI are verified\n\n    Examples: \n      | clr   | surcharge                  | paytext    | cnl    |\n      | Clear | Inclusive Surcharge = 0.31 | PAY £ 3.43 | CANCEL |\n\n  @OnboardingDriverPayment\n  Scenario Outline: QR Code Payment Verification\n    Given check that Driver are in STC status by verifying clear \"<clr>\" button text for QR Code payments\n    When Click on QR Code payment button so that QR Code payment alert are opned\n    And check for QR Code \"<code>\" text\n    And check for QR Code area\n    And check for QR code close \"<close>\" text\n    And click on Close button so that QR code alert closed\n    And click to clear and submit the job with all payments\n    Then QR Code UI are also ver
